import React, { Component } from 'react';
import PropTypes from 'prop-types';


class TodoItem extends Component {
  render() {
    return (
      <h3>
        { this.props.todo.title}
      </h3>
    )
  }
}

TodoItem.PropTypes = {
    todo: PropTypes.object.isRequired
}

export default TodoItem;
